import React, { forwardRef } from 'react'
import styles from './Input.module.css'

const Input = forwardRef(({ id, label, input }, ref) => {
    return (
        <div className={styles.input}>
            <label htmlFor={input.id}>{label}</label>
            <input ref={ref} {...input} />
        </div>
    )
});

export default Input
